import react, {Component} from "react";

class Data extends Component {

    data = [
        {
            "value": "Yes", 
            "percent":35,
        },
        {
            "value": "No",
            "percent": 27,
        },
        {
            "value": "Don't Know", 
            "percent": 38,
        },
    ]


}

export default Data;
